INSERT INTO `notify` VALUES (1,'Hỗ trợ nhiệm vụ','1) Hỗ trợ nhiệm vụ TĐST:\r\nNgày thứ 2-3-4 trong tuần từ 5h\r\nđến 7h và từ 17h đến hết 19h,\r\nchỉ những cư dân đang làm nhiệm\r\nvụ này mới vào được map có boss,\r\nnày xuất hiện.\r\n(Núi khỉ đen, hang khỉ đen, núi khỉ\r\nđỏ).\r\n\r\n2) Hỗ trợ nhiệm vụ Xên Bọ Hung:\r\nNgày thứ 2-3-4 trong tuần, từ 2 giờ\r\nsáng đén hết 4 giờ sáng và từ 2 giờ\r\nchiều đến hết 4 giờ chiều, chỉ\r\nnhững cư dân đang làm nhiệm vụ\r\nnày mới vào được map có boss này\r\nxuất hiện.\r\n(Thị trấn Ginder, Võ đài Xên bọ\r\nhung).');
/*!40000 ALTER TABLE `notify` ENABLE KEYS */;
UNLOCK TABLES;

